text.info:
ConstantValue: precision mediump float;
uniform sampler2D tex_sampler_0;
uniform sampler2D tex_sampler_1;
varying vec2 v_texcoord;
void main() {
  vec4 original = texture2D(tex_sampler_0, v_texcoord);
  vec4 mask = texture2D(tex_sampler_1, v_texcoord);
  gl_FragColor = vec4(original.rgb * (1.0 - mask.a) + mask.rgb, 1.0);
}
